I'm not sure what you mean by "implement it with 0-3 pipes and 0-1 pays".

If you mean that you want to use 0-3 pipes and 0-1 pays in your shell, then you can do that by using the `pipe` and `exec` functions in your shell.

Here is an example of how you might use the `pipe` function to create a pipe and the `exec` function to execute a command with its input connected to the pipe:
```
int pipefd[2];
pipe(pipefd);

pid_t pid = fork();
if (pid == 0) {
  // Child process
  close(pipefd[0]); // Close the read end of the pipe
  dup2(pipefd[1], STDOUT_FILENO); // Connect the write end of the pipe to stdout
  close(pipefd[1]); // Close the write end of the pipe

  // Execute the command
  execlp("ls", "ls", NULL);
} else {
  // Parent process
  close(pipefd[1]); // Close the write end of the pipe
  dup2(pipefd[0], STDIN_FILENO); // Connect the read end of the pipe to stdin
  close(pipefd[0]); // Close the read end of the pipe

  // Execute the command
  execlp("grep", "grep", "foo", NULL);
}
```
This will create a pipe, fork a child process, and execute the `ls` command in the child process with its output connected to the pipe. The parent process will then execute the `grep` command with its input connected to the pipe.

You can use multiple pipes and `exec` calls to create more complex pipelines with multiple commands. For example, you could create a pipeline with three commands like this:
```
int pipefd1[2];
int pipefd2[2];

pipe(pipefd1);
pipe(pipefd2);

pid_t pid1 = fork();
if (pid1 == 0) {
  // First child process
  close(pipefd1[0]);
  dup2(pipefd1[1], STDOUT_FILENO);
  close(pipefd1[1]);

  execlp("ls", "ls", NULL);
}

pid_t pid2 = fork();
if (pid2 == 0) {
  // Second child process
  close(pipefd1[1]);
  dup2(pipefd1[0], STDIN_FILENO);
  close(pipefd1[0]);
  close(pipefd2[0]);
  dup2(pipefd2[1], STDOUT_FILENO);
  close(pipefd2[1]);

  execlp("grep", "grep", "foo", NULL);
}

